import React, { useEffect, useState } from "react";
import axios from "axios";

const HomeList = () => {
  const [homes, setHomes] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const homesResponse = await axios.get(
        "https://api.secondhomeseniors.com/items/homes/"
      );

      const homesData = homesResponse.data.data;

      // Fetching rooms for each home
      const homesWithRoomsPromises = homesData.map(async (home) => {
        const roomsResponse = await axios.get(
          `https://api.secondhomeseniors.com/items/rooms/?filter[home][equals]=${home.id}`
        );
        const roomsData = roomsResponse.data.data;
        return {
          ...home,
          rooms: roomsData,
        };
      });

      const homesWithRooms = await Promise.all(homesWithRoomsPromises);

      setHomes(homesWithRooms);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  return (
    <div>
      <h1>Home List</h1>
      <ul>
        {homes.map((home) => (
          <li key={home.homeId}>
            <p>City: {home.city}</p>
            <ul>
              {home.rooms.map((room) => (
                <li key={room.id}>
                  <p>Room Name: {room.name}</p>
                  {/* Display other room properties as needed */}
                </li>
              ))}
            </ul>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default HomeList;
